function isTel(s) {
    //var patrn=/^[+]{0,1}(\d){1,3}[ ]?([-]?(\d){1,12})+$/; 
    var patrn = /^[+]{0,1}(\d){1,3}[ ]?([-]?((\d)|[ ]){1,12})+$/;
    if (!patrn.exec(s.value)) 
    {
       alert(~ Illegal phone number format .~);
       return false;
    }
    return true
}

function isPostalCode(c) {
    var val = c.value;
    if (val == ~~)
        return;
    if (val.length != 6) {
        c.select();
        c.focus();
        alert(~ Illegal ZIP code format .~);
        return false;
    }
    var patrn = /^[0-9]+$/;
    if (!patrn.exec(val)) {
        c.select();
        c.focus();
        alert(~ Illegal ZIP code format .~);
        return false;
    }
    return true
}

function isMobil(c) {
    var patrn = /^[+]{0,1}(\d){1,3}[ ]?([-]?((\d)|[ ]){1,12})+$/;
    if (c.value == ~~)
        return;
    if (!patrn.exec(c.value)) {
        c.focus();
        c.select();
        alert(~ Illegal phone number .~);
        return false;
    }
    return true
}

function checkMail(c) {
    var email = c.value;
    if (email == ~~)
        return;

    // Presence @ Symbol 
    var a = email.indexOf("@");
    // The existence of points 
    var point = email.indexOf(".");
    // Presence @,点, And   Point @ After that , Not adjacent 
    if (a == -1 || point == -1 || point - a <= 1) {
        alert("Email Incorrect format . Right example abc@ccflow.org");
        c.select();
        c.focus();
        return false;
    }
    //@ Can not be the first character , Point can not be the last character 
    if (a == 0 || point == email.length - 1) {
        alert("Email Incorrect format . Right example abc@ccflow.org");
        c.select();
        c.focus();
        return false;
    }
    return true;
}
